import { BrowserRouter, Route, Switch } from "react-router-dom";
import Coin from "./Coin";
import Coins from "./Coins";

export default function Router() {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/:coinId" component={Coins}>
          {/* <Coin></Coin> */}
        </Route>
        <Route path="/">
          <Coins></Coins>
        </Route>
      </Switch>
    </BrowserRouter>
  );
}
